import React from "react";
import blogData from "../blog.json";

const Blog = () => {
  return (
    <div>
      <h1>Blog</h1>
      {blogData.map((item) => (
        <div>
          <h1>{item.title}</h1>
          <p>{item.text}</p>
        </div>
      ))}
      
    </div>
  );
};

export default Blog;
